import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import TestBfa from "./TestBfa";

const Test = () => {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/testbfa" element={<TestBfa />} />
        </Routes>
      </Router>
    </div>
  );
};

export default App;
